import axios from "axios";

export const makeRequest = axios.create({
    baseURL: ProcessingInstruction.env.REACT_APP_API_URL,
    headers: {
        Authorization: "bearer " + ProcessingInstruction.env.REACT_APP_API_TOKEN,
    }
})
